import React from "react";
import { Link } from "react-router-dom";

export default function ManagerDashboard() {
  return (
    <div>
      <h2>Manager Dashboard</h2>
      <ul>
        <li>
          <Link to="/manager/orders">Manage Orders</Link>
        </li>
        <li>
          <Link to="/manager/products">Manage Products</Link>
        </li>
        <li>
          <Link to="/manager/suppliers">Manage Suppliers</Link>
        </li>
      </ul>
      <p>Welcome, Manager! Use the links above to manage orders, products, and suppliers.</p>
    </div>
  );
}
